INSERT INTO `posts` (`id`, `title`, `slug`, `body`, `author_id`, `status`, `updated_on`, `created_on`) VALUES
(1, 'GJCHS website launched', 'gjchs-website-launched', '<p></p><p>GJCHS new &nbsp;website launched. All project details are also updated some of the key new features of website include</p><p><ul><li><span style="line-height: 22.5px;">Now member can login and check the payment details and history</span></li><li><span style="line-height: 22.5px;">Announcements will be send to provided email addresses&nbsp;</span></li></ul><div>More exciting features to be included in near future to make the e-service even better. Give us your suggestions and feedback to improve our services.&nbsp;</div><div>Thanks&nbsp;</div><div>GJCHS I.T Team</div></p>\r\n', 3, 2, '2013-07-08 09:24:38', '2012-11-22 11:51:53'),
(5, 'Construction Work started', 'construction-work-started', '<p>Construction Work started</p>', 4, 2, '2013-07-08 10:00:50', '2013-07-08 10:00:50'),
(6, 'GJCHS board meeting', 'gjchs-board-meeting', '<p>Board meeting date will be announced soon</p>', 4, 2, '2013-07-08 10:01:33', '2013-07-08 10:01:33');
